import React, {useState} from 'react'
import { useSelector, useDispatch } from 'react-redux';
import { loginClassDispatched } from './loginSlice';
import { useGetUsersMutation } from '../api/apiSlice';


const Login = () => {

  const dispatch = useDispatch()
  const loginClass = useSelector(state => state.loginClass)

  // close login page

  const closeLogin = () => {
    if (loginClass.value !== false) {
      dispatch(
        loginClassDispatched(false)
      )
    }
  }

  // input states
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')

  const onEmailChange = (e) => setEmail(e.target.value)
  const onPasswordChange = (e) => setPassword(e.target.value)

  // check user data
  const [user] = useGetUsersQuery
